settings.cardCss:
body {
            background-color: #333;
            color: #fff;
            font-family: Arial, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
        }

        .container {
            text-align: center;
            width: 100%;
            height: 100%;
        }

        h1 {
            font-size: 2em;
            margin-bottom: 30px;
            color: #f8fdf6;
        }

        .logo {
            width: 170px;
            margin-bottom: 120px;
        }
        home-icon {
            display: flex;
            margin-top: 3px;
            justify-content: left;
        }
        
        .home-prop {
            height: 50px;
            width: 50px;
            margin-top: 20px;
            cursor: pointer;
            border-radius: 25px;
            /* Add an icon as the background image */
            background-image: url('https://energy-app.utech-iiot.lk/api/images/public/CT4OWEPgqkOvL4MeDMGyfT8HJlz2LP5U');
            /* Replace 'icon.png' with your icon's path */
            background-size: cover;
            /* Resize the image to cover the div */
            background-repeat: no-repeat;
            background-position: center;
            /* Center the icon inside the div */
        }

        .menu {
            margin-top: 100px;
            display: grid;
            grid-template-columns: repeat(2, 1fr); 
            gap: 1px;
            justify-items: center;
        }

        .menu-view-8 {
            text-align: center;
            margin: 0 -90px;
            cursor: pointer;
            margin-bottom: 30px;
        }

        .menu-view-8 img {
            width: 120px;
            height: 140px;
            display: block;
            margin: 0 auto 10px;
        }

        .menu-view-8 p {
            margin: 0;
            font-size: 1.5em;
            color: #f8fdf6;
        }
        .menu-view-8:hover {
            background-color: #555;
            border-radius: 8px;
            transition: background-color 0.3s ease;
        }
        .status-box {
            display: flex;
            flex-direction: column;
            gap: 5px;
            margin-left: 13px;
            font-size: 0.9em;
            justify-content: center;
        }

        .status-table {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 1px;
            text-align: center;
            border: 1px solid #888;
            padding: 1px;
            background-color: #444;
            border-radius: 8px;
        }

        .status-cell {
            padding: 10px;
            border-radius: 4px;
            color: white;
        }
        
        .green {
            background-color: #4CAF50;
        }

        .red {
            background-color: #FF4C4C;
        }

        .threshold-values {
        font-size: 1.2em;
        color: #fff;
        }

config.widgetCss:
.container {
    position: relative; 
    padding: 20px; 
    z-index: 1; 
}

.container::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: url('https://energy-app.utech-iiot.lk/api/images/public/KFLj8Z9sO5VUTdh58sakx3OZWIWHePxm') no-repeat center center;
    background-size: cover;
    opacity: 0.6; 
    z-index: -1; 
}
